import React, { Component } from 'react';

import Button from './Button';

class Header extends Component {
  static displayName = Header.name;

  render () {
    return (
      <div className="w-full border-b border-gray-200">
        <div className='pt-3 pb-3 max-w-3xl mx-auto flex justify-between'>
          <div className='text-3xl pt-1'>Watermango</div>
          <Button name='Login' borderColor='border-green-500' hoverBorderColor='border-green-400' />
        </div>
      </div>
    );
  }
}

export default Header;
